// LogInUser.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { Row, Form, Col, Button, Container, Modal } from 'react-bootstrap';
import './LogIn.css';
import NavigationalBar from '../landpage/navbar';
import { ip } from '../../ContentExport';
import { usePatient } from '../patient/PatientContext';

const LogInUser = () => {
    const navigate = useNavigate();
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [userRole, setUserRole] = useState("Patient");
    const [rememberMe, setRememberMe] = useState(false);
    const [showModal, setShowModal] = useState(false);
    const [modalEmail, setModalEmail] = useState("");
    const [modalMessage, setModalMessage] = useState("");

    const { setPatient } = usePatient();

    const loginuser = async (e) => {
        e.preventDefault();

        try {
            const response = await axios.post(`${ip.address}/patient/api/login`, {
                email,
                password,
            });

            if (response.data.patientId) {
                const patientData = response.data;

                // Handle "Remember Me"
                if (rememberMe) {
                    localStorage.setItem('patient', JSON.stringify(patientData));
                } else {
                    sessionStorage.setItem('patient', JSON.stringify(patientData));
                }

                setPatient(patientData);
                window.alert("Successfully logged in");
                navigate(`/homepage`);
            } else {
                window.alert(response.data.message || "Invalid email or password. Please try again.");
            }
        } catch (err) {
            console.error('Error logging in:', err);
            window.alert("An error occurred while logging in.");
        }
    };

    const handleForgotPassword = async (e) => {
        e.preventDefault();

        try {
            const response = await axios.post(`${ip.address}/patient/api/forgot-password`, { email: modalEmail });
            setModalMessage(response.data.message);
        } catch (err) {
            console.error('Error in forgot password:', err);
            setModalMessage(err.response?.data?.message || 'An error occurred.');
        }
    };

    return (
        <>
            <NavigationalBar />
            <div className="align-items-center d-flex vh-100">
                <Container fluid className="maincontainer d-flex justify-content-center align-items-center">
                    <div className="container">
                        <h1>Welcome Back!</h1>
                        <Form>
                            <Row className="mb-3">
                                <Form.Group className="mb-3" controlId="formEmail">
                                    <Form.Label>Email Address</Form.Label>
                                    <Form.Control
                                        type="email"
                                        placeholder="Enter Email Address"
                                        value={email}
                                        onChange={(e) => setEmail(e.target.value)}
                                    />
                                </Form.Group>
                            </Row>
                            <Row className="align-items right">
                                <Form.Group className="mb-3" controlId="formPassword">
                                    <Form.Label>Password</Form.Label>
                                    <Form.Control
                                        type="password"
                                        placeholder="Enter Password"
                                        value={password}
                                        onChange={(e) => setPassword(e.target.value)}
                                    />
                                </Form.Group>
                            </Row>
                            <Row className="mb-3">
                                <Form.Group controlId="formBasicCheckbox">
                                    <Form.Check
                                        type="checkbox"
                                        label="Remember me"
                                        checked={rememberMe}
                                        onChange={(e) => setRememberMe(e.target.checked)}
                                    />
                                </Form.Group>
                            </Row>
                            <div className="justify-content-center">
                                <Button type="submit" className="mb-2 buttonStyle" onClick={loginuser}>
                                    Log In
                                </Button>
                            </div>
                            <div className="mb-0">
                                <a href="#" onClick={() => setShowModal(true)}>Forgot Password?</a>
                            </div>
                            <div className="mb-0">
                                <a href="/medapp/signup">No account yet? Sign up</a>
                            </div>
                        </Form>
                    </div>
                </Container>
            </div>

            {/* Forgot Password Modal */}
            <Modal show={showModal} onHide={() => setShowModal(false)}>
                <Modal.Header closeButton>
                    <Modal.Title>Forgot Password</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    {modalMessage ? (
                        <p>{modalMessage}</p>
                    ) : (
                        <Form onSubmit={handleForgotPassword}>
                            <Form.Group className="mb-3" controlId="formModalEmail">
                                <Form.Label>Email Address</Form.Label>
                                <Form.Control
                                    type="email"
                                    placeholder="Enter Email Address"
                                    value={modalEmail}
                                    onChange={(e) => setModalEmail(e.target.value)}
                                />
                            </Form.Group>
                            <Button variant="primary" type="submit">
                                Submit
                            </Button>
                        </Form>
                    )}
                </Modal.Body>
            </Modal>
        </>
    );
};

export default LogInUser;
